// ArtistTile.jsx
import React from "react";
import "./ArtistTile.scss";
import Button from "./components/button/Button";

const ArtistTile = (props) => {
  let artistStyle = "artisttile ";

  if (props.isSecondary === true) {
    buttonStyle += "artist--secondary";
  } else {
    buttonStyle += "artist--primary";
  }

  return (
    <div className={props.artistStyle}>
      {props.artistText}
      <Button buttonText={"button text"} isSecondary={true} />
    </div>
  );
};

export default ArtistTile;
